// src/components/Achievements.js
import React from 'react';
import './Achievements.css';

function Achievements() {
  return (
    <section className="Achievements">
      <h2>Achievements</h2>
      <div>
      <ul>
        <div id="a1"><li>Participated in national coding competitions and hackathons, showcasing problem-solving abilities.</li></div>
        <div id="a2" ><li>Secured 1st place in a 24-hour Hackathon for innovative software solution development.</li></div>
      </ul>
      </div>
    </section>
  );
}

export default Achievements;
